Five Minutes of Heaven (2009)  

Verenigd Koninkrijk / Ierland
Drama
90 minuten

geregisseerd door Oliver Hirschbiegel
met Liam Neeson, James Nesbitt en Anamaria Marinca

Het verhaal draait om twee mannen wiens levens verwoest werden door de gewelddadige conflicten in Noord-Ierland van eind de jaren '60 tot het vredesproces in 1998. De ene man, Alistair, is een moordenaar; de andere, Joe, is de broer van de man die hij heeft vermoord. Alistair durft niet om vergiffenis te vragen, terwijl Joe zich onbekwaam voelt om dit te geven.


